import "../CSS/"

function ProjectItems({ name, image }) {
    return (
        <div className='ProjectItems'>

            <div className="projectImage">
                <img src={image} alt={name} />
            </div>
            <div className="projectTitle">
                <h3>{name}</h3>
            </div>

        </div>
    )
}
export default ProjectItems;
